import React, { Component } from 'react'
import { Routes, Route } from "react-router-dom";
import User from "./components/User";

export default class App extends Component {
  render() {
    return (
      <div>
        <Routes>

          <Route exact path=" " Component={<User/>}/>

        </Routes>
      </div>
    )
  }
}
